(window.webpackJsonp=window.webpackJsonp||[]).push([[16],{222:function(A){A.exports={data:{post:{title:"Banana",date:"1970",content:"<p>The <strong>banana</strong> fruits grow from a <strong>banana</strong> blossom in hanging clusters, also called a bunch or <strong>banana</strong> stem. The fruits grow in rows called tiers or hands. There can be as many as twenty fruits to a hand, and as many as twenty tiers in a bunch. A bunch usually weighs between 30 and 50 kilograms (65 to 110 pounds).</p>\n<p><img class=\"g-image g-image--lazy g-image--loading\" src=\"data:image/svg+xml,%3csvg fill='none' viewBox='0 0 2560 1583' xmlns='http://www.w3.org/2000/svg' xmlns:xlink='http://www.w3.org/1999/xlink'%3e%3cdefs%3e%3cfilter id='__svg-blur-7'%3e%3cfeGaussianBlur in='SourceGraphic' stdDeviation='40'/%3e%3c/filter%3e%3c/defs%3e%3cimage x='0' y='0' filter='url(%23__svg-blur-7)' width='2560' height='1583' xlink:href='data:image/jpeg%3bbase64%%2bVGT3%2bDhcun1F05lTj79sjeFlkhxT1rCiWSTaYFUVpVcclQtOzQVyXBzUsuHdY9lkPNSDJLhTad%2bk/BO3scHI%2bVFDh/qeTX%2bpbHgk%2bZ9RjWj%2bqxtAaAFglC43KqytPa0imyn5KWRucnu77egXV2W1na6VPVrldef00%2b5eonKwkd%2biIoboREQBERAEREAREQH/2Q==' /%3e%3c/svg%3e\" width=\"2560\" data-srcset=\"/assets/static/mike-dorner-173502-unsplash.82a2fbd.cd30488.jpg 480w, /assets/static/mike-dorner-173502-unsplash.cbab2cf.cd30488.jpg 1024w, /assets/static/mike-dorner-173502-unsplash.2665e34.cd30488.jpg 1920w, /assets/static/mike-dorner-173502-unsplash.42db587.cd30488.jpg 2560w\" data-sizes=\"(max-width: 2560px) 100vw, 2560px\" data-src=\"/assets/static/mike-dorner-173502-unsplash.42db587.cd30488.jpg\"><noscript><img class=\"g-image g-image--lazy g-image--loaded\" src=\"/assets/static/mike-dorner-173502-unsplash.42db587.cd30488.jpg\" width=\"2560\"></noscript></p>\n",categories:["photography","pink"],projectBgColor:"",projectFgColor:""}}}}}]);